import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

import Zoom from "@material-ui/core/Zoom";

const styles = theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap",

    align: "center",
    float: "none",
    margin: "0 auto"
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200
  },
  dense: {
    marginTop: 19
  },
  menu: {
    width: 200
  },
  button: {
    margin: theme.spacing.unit
  },

  leftIcon: {
    marginRight: theme.spacing.unit
  },
  rightIcon: {
    marginLeft: theme.spacing.unit
  },
  iconSmall: {
    fontSize: 20
  }
});

export let details = "";

class EntschaedigungErhalten extends React.Component {
  constructor() {
    super();
    this.state = {
      mitreisende: "",
      radioZahlung: "",
      textZahlung: "",
      radioForderung: ""
    };
    this.sendDataToParent = this.sendDataToParent.bind(this);
  }

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value
    });
  };
  onRadioChange(value) {
    this.setState({
      radioZahlung: value
    });
  }
  onRadioChange1(value) {
    this.setState({
      radioForderung: value
    });
  }

  enterDetails = btnText => {
    details = (
      <div>
        <Zoom in={true} timeout={400}>
          hhh
        </Zoom>
      </div>
    );
  };

  sendDataToParent() {
    if (this.state.text !== "") {
      this.props.clickedButtonReason(this.state);
    }
    return;
  }

  render() {
    const { classes } = this.props;

    return (
      <form className={`${classes.container}`} noValidate autoComplete="off">
        <div className={"chooser"}>
          <TextField
            id="outlined-name"
            type="number"
            label="Mitreisende"
            className={classes.textField}
            value={this.state.name}
            onChange={this.handleChange("mitreisende")}
            margin="normal"
            variant="outlined"
          />
          <h5>Hast du von der Fluggesellschaft ein Angebot erhalten?</h5>
          <form>
            <div>
              <input
                type="radio"
                id="ja"
                name="drone"
                value="Ja"
                onChange={e => this.onRadioChange("ja")}
              />
              <label htmlFor="ja">Ja</label>
            </div>

            <div>
              <input
                type="radio"
                id="nein"
                name="drone"
                value="Nein"
                onChange={e => this.onRadioChange("nein")}
              />
              <label htmlFor="nein">Nein</label>
            </div>
          </form>
          {details}
          <h5>Hast du bereits eine Zahlung erhalten?</h5>
          <form>
            <div>
              <input
                type="radio"
                id="ja"
                name="drone"
                value="Ja"
                onChange={e => this.onRadioChange1("ja")}
              />
              <label htmlFor="ja">Ja</label>
            </div>

            <div>
              <input
                type="radio"
                id="nein"
                name="drone"
                value="Nein"
                onChange={e => this.onRadioChange1("nein")}
              />
              <label htmlFor="nein">Nein</label>
            </div>
          </form>
        </div>
      </form>
    );
  }
}

EntschaedigungErhalten.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(EntschaedigungErhalten);
